import React from 'react';
import CustomButtons from '../../component/Button/CustomButtons';

const CustomButton = () => {
    return (
        <div>
            <h3>Hello custom button</h3>
            <CustomButtons>Click ME </CustomButtons>
        </div>
    );
};

export default CustomButton;<h3>Hello cutom button</h3>
